import React from 'react';
import graph_image from "../img/graph.png"
function Home() {
    return (
        <div>
            <h1>Welcome to sleep&see</h1>
            <p>a site made to record and visualize your sleep</p>
            <a href="/login">
                <button>Try it out</button>
            </a>
            <div className="col-md-5 col-xs-12">
                <img className="graph-image" src={graph_image} alt='team color'></img>
            </div>
        </div>
    );
}

export default Home;
